import React, { Component } from 'react';
import "./css/projects.css"
import Project from './Project'

class InfoProject{
    constructor(title,description,img,projectLink,codeLink){
        this.title = title;
        this.description = description;
        this.img = img;
        this.projectLink = projectLink;
        this.codeLink = codeLink;
    }
}

//Proper links
let projectArray = [
    new InfoProject("DNA Linker","A game I made for GMTK 2020","test.jpeg","https://im-na.itch.io/dna-linker",""),
    new InfoProject("Django Website","Website I made using bootstrap and python django","jsLogo.svg","","")
];



export default class Projects extends Component {

    render() {
        return (
           
            <div className="pad">
            <h3>Projects</h3>
            {projectArray.map((proj) =>{
                const {title,description,img,projectLink,codeLink} = proj;

                return (
                    <Project title={title} description={description} img={img} projectLink={projectLink} codeLink={codeLink}/>
                )
            })

            }
            </div>
        )
    }
}
